import React from 'react'
import '../ContactUs/ContactUs.css'
import dividerWhite from '../../assets/divider_white_u72.png'

export default function ContactUs() {
    return (
        <div className='contactUs'>
            {/* contactUs top */}
            <div className="contactUs-t">
                <p>CONTACT US</p>
                <img src={dividerWhite} alt="" />
            </div>
            {/* contactUs center */}
            <div className="contactUs-c">
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Alias, autem.</p>
            </div>
             {/* contactUs bottom */}
             <div className='contactUs-b'> 
                <button className='customSection-btn'>Sen</button>
            </div>
        </div>
    )
}
